import React from 'react';
import './App.css';

import {Switch, Route, Redirect} from "react-router-dom";
import Paginate from "./pagination";

function App() {
  return (
    <div className="App">
      <Switch>
        <Paginate />
      </Switch>
    </div>
  );
}

export default App;
